import React from 'react';
import CardItems from './CardItems';
import { Link } from 'react-router-dom';
function LeatestProject() {
  return (
    <div>
  
         <div className='text-center mt-5 text-white'><span className=' font-serif font-bold text-2xl'>
             <span>Leatest </span><span className="text-cyan-400">Project</span>
             </span>
          </div>
            <div className='flex  flex-col sm:flex-row items-center justify-around h-screen'>
              <div><Link><CardItems src = {'wordCounter.jpg'} project={"WordCounter"}/></Link></div>
              <div><CardItems src = {'OIP.jpg'} project={"Ecommerce"}/></div>
              <div><CardItems src = {'hotel.jpg'} project={"Hotel Booking"}/></div>
          
            </div>
          </div>
  
  )
}

export default LeatestProject
